import React from "react";
import "./style.css";
import signOutIcon from "../../assets/images/newicons/logout-white.svg";


export default AddPostBtn = ({ modalOpen, setModalOpen }) => {
  return (
    <div className="dl-p-signout" onClick={() => setModalOpen(true)}>
        <img src={signOutIcon} alt="#" />
    </div>
  );
};
